import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './components/Home'; // Import your Home component
import CsvUpload from './components/CsvUpload'; // Import your CsvUpload component
import DataPreview from './components/DataPreview'; // Import your DataPreview component
import InsertData from './components/InsertData'; // Import your InsertData component

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={Home} />
        <Route path="/csv-upload" component={CsvUpload} />
        <Route path="/data-preview" component={DataPreview} />
        <Route path="/insert-data" component={InsertData} />
      </Switch>
    </Router>
  );
}

export default App;
